import React from "react";

class Weather extends React.Component {
  render() {
    return( 
      <div>
       
        {this.props.city}
        {this.props.country}
        {this.props.temp}
        {this.props.sunrise}
        {this.props.sunset}
        {this.props.error}
        
      </div>
    );
  }
}

export default Weather;
